(22, 'O\'zbek xalqi hech qachon, hech kimga qaram bo\'lmaydi', 'Islom Karimov', NULL, NULL, NULL, 'Bugun mustaqil davlatimiz,ozod mamlakatimiz bir yoshga ulg\'aymoqda.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2005, '', '', '66.4(5u)', NULL, NULL, 448, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-12 23:18:54', '2021-07-14 00:21:14', '5-640-03220-0-2', NULL, 0, 0, NULL, NULL),
(23, 'Inson,uning huquq va erkinliklari-oliy qadriyat', 'Islom Karimov', NULL, NULL, NULL, 'O\'zbekiston Respublikasi Presidenti Islom Karimov asarlarining 14-jildidan davlatimiz rahbarining 2005 yil iyulidan 2006 yil avgustgacha bo\'lgan davr mobaynida mamlakatimiz Oliy Majlisi senati va mahalliy kengashlar yig\'ilishlari, xalqaro uchrashuvlar va tantanali marosimlarda ma\'ruza,nutq va chiqishlari hamda tabriklari o\'rin olgan.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2006, '', '', '323', NULL, NULL, 280, 3123, 1, 1, 3, 1, 2, 2, 2, '2021-07-12 23:22:54', '2021-07-12 23:34:32', '5-640-02961-7', NULL, 0, 1, NULL, NULL),
(24, 'Jamiyatimizni erkinlashtirish, islohatlarni chuqurlashtirish, ma\'naviyatimizni yuksaltirish va xalqimizning hayot darajasini oshirish- barcha ishlarimizning mezoni va maqsadidir.', 'Islom Karimov', NULL, NULL, NULL, 'Yurtboshimizning mehnat jamoalari vakillari bilan uchrashuvga chiqishlari', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2007, '', '', '66.3(5u)', NULL, NULL, 320, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-12 23:32:53', '2021-07-12 23:35:18', '978-9943-01-150-2', NULL, 0, 1, NULL, NULL),
(25, 'Vatanimizning bosqichma-bosqich va barqaror rivojlanishini ta\'minlash-bizning oliy maqsadimiz', 'Islom Karimov', NULL, NULL, NULL, 'O\'zbekiston Respublikasi Prezidenti Islom Karimov asarlarining 17-jildidan davlatimiz rahbarining 2008-2009 yillarida Vazirlar Mahkamasi,Xalq deputatlari viloyatlar kengashlari yig\'ilishlari,turli xalqaro anjumanlar,tantanali marosimlarda so\'zlagan nutqlari va ma\'ruzalari xamda tabriklari o\'rin olgan.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2009, '', '', '323', NULL, NULL, 280, 0, 1, 1, 3, 1, 1, 2, 2, '2021-07-12 23:40:04', '2021-07-12 23:55:23', '978-9943-01-462-6', NULL, 0, 1, NULL, NULL),
(26, 'Обеспечить поступательное и устойчивое развитие страны-важнейшая наша задача', 'Ислам Каримов', NULL, NULL, NULL, 'В семнадцатый том произведений Президента Республики Узбекистан И.А.Каримова включены доклады и речи руководителя нашей страны за 2008-2009 годы заседаниях Кабинета Министров Республики Узбекистан,его выступления на различных международных форумах, торжественных церемониях, а также его поздравления.', NULL, NULL, NULL, 'Узбекистан', NULL, NULL, NULL, NULL, 'Ташкент', 2009, '', '', '323', NULL, NULL, 184, 0, 1, 1, 3, 2, 2, 2, 2, '2021-07-12 23:45:32', '2021-07-12 23:45:32', '978-9943-01-463-3', NULL, 0, 1, NULL, NULL),
(27, 'Либерализация общества,углубление реформ,повышение духовности и уровня жизни народа-критерий и цель всей нашей деятельности.', 'Ислам Каримов', NULL, NULL, NULL, 'В настоящий том также вошли речи выступления Призидента на совешаниях', NULL, NULL, NULL, 'Узбекистан', NULL, NULL, NULL, NULL, 'Toshkent', 2007, '', '', '66.3(5u)', NULL, NULL, 208, 4000, 1, 1, 3, 2, 1, 1, 1, '2021-07-12 23:49:31', '2021-07-12 23:49:31', '978-9943-01-151-9', NULL, 0, 1, NULL, NULL),
(28, 'Jahon inqirozining oqibatlarini yengish,mamlakatimiz modernizatsiya qilish va taraqqiy topgan davlatlar darajasiga ko\'tarilish sari.', 'Islom Karimov', NULL, NULL, NULL, 'O\'zbekiston Respublikasi Islom Karimov asarlarinig 18-jildidan davlatimiz rahbarining 2009-2010-yillarida Vazirlar Mahkamasi yig\'ilishlari,O\'zbekiston respublikasi Oliy Majlisi Qonunchilik palatasi va Senatning qo\'shma majlisida,turli xalqaro anjumanlar,marosimlarda so\'zlagan nutqlari va ma\'ruzalari hamda tabriklari o\'rin olgan.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2010, '', '', '323', NULL, NULL, 264, 0, 1, 1, 3, 1, 1, 2, 2, '2021-07-12 23:54:46', '2021-07-12 23:57:49', '978-9943-01-610-1', NULL, 0, 1, NULL, NULL),
(29, 'Barkamol avlod orzusi', 'Islom Karimov', NULL, NULL, NULL, 'Shuni alohida ta\'kidlash lozimki, ta\'lim-tarbiya sohasida islohotlar o\'tkazish va ularning asosiy yo\'nalishlari, talablari va maqsadlarini aniqlash hamda tegishli xulosalarni chiqarishda, bugungi muhokama qilinadigan hujjatlarda keng jamoatchiligimizning fikr-mulohazalari, tavsiya va izohlari ifoda topgan.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 1998, '', '', '323.1', NULL, NULL, 184, 260, 1, 1, 3, 1, 2, 1, 1, '2021-07-12 23:58:52', '2021-07-12 23:58:52', '0', NULL, 0, 1, NULL, NULL),
(30, 'Mamlakatni modernizasiya qilish va iqtisodiyotimizning barqaror rivojlantirish yo\'lida.', 'Islom Karimov', NULL, NULL, NULL, 'Xalq deputatlari viloyatlar kengashlari yigilishlari', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2008, '', '', '66.3(5u)', NULL, NULL, 368, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-12 23:59:01', '2021-07-12 23:59:01', '978-9943--01-297-4', NULL, 0, 1, NULL, NULL),
(31, 'Jahon inqirozining oqibatlarini yengish,mamlakatimiz modernizatsiya qilish va taraqqiy topgan davlatlar darajasiga ko\'tarilish sari.', 'Islom Karimov', NULL, NULL, NULL, 'O\'zbekiston Respublikasi Islom Karimov asarlarinig 18-jildidan davlatimiz rahbarining 2009-2010-yillarida Vazirlar Mahkamasi yig\'ilishlari,O\'zbekiston respublikasi Oliy Majlisi Qonunchilik palatasi va Senatning qo\'shma majlisida,turli xalqaro anjumanlar,marosimlarda so\'zlagan nutqlari va ma\'ruzalari hamda tabriklari o\'rin olgan.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2010, '', '', '323', NULL, NULL, 280, 0, 1, 1, 3, 1, 2, 2, 2, '2021-07-12 23:59:14', '2021-07-12 23:59:14', '978-9943-01-577-7', NULL, 0, 1, NULL, NULL),
(32, 'Demokaratik islohatlarni yanada chuqurlashtirish va fuqarolik jamiyatini shakllantirish-mamlakatimiz taraqqiyotining asosiy mezondir.', 'Islom Karimov', NULL, NULL, NULL, 'O\'zbekiston Respublikasi Islom Karimov asarlarinig 19-jildidan davlatimiz rahbarining 2010-2011-yillarida Vazirlar Mahkamasi yig\'ilishlari,O\'zbekiston respublikasi Oliy Majlisi Qonunchilik palatasi va Senatning qo\'shma majlisida,BMT bosh assambleyasining Mingyillik rivojlanish Maqsadlariga bag\'ishlangan oliy darajadagi yalpi majlisida,Kollektiv xavfsizlik shartnomasi tashkiloti (ODKB),turli xalqaro anjumanlar,marosimlarda so\'zlagan nutqlari va ma\'ruzalari hamda tabriklari o\'rin olgan.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2011, '', '', '323', NULL, NULL, 348, 6930, 1, 1, 3, 1, 1, 2, 2, '2021-07-13 00:09:37', '2021-07-13 00:09:37', '978-9943-01-746-7', NULL, 0, 1, NULL, NULL),
(33, 'Erishgan marralar bilan chegaralanmasdan, boshlagan islohotlarimizni yangi bosqichga ko\'tarish-bugungi kundagi eng dolzarb vazifamizdir', 'Islom Karimov', NULL, NULL, NULL, 'O\'zbekiston Respublikasi Birinchi Prezidenti Islom Karimov asarlarining 23-jildidan davlatimiz rahbarining 2014-2015 yillarda mamlakatimiz parlamenti palatalari, Vazirlar Mahkamisining majlislarida, O\'zbekiston Respublikasi Konstitutsiyasining 22 yilligiga bag\'ishlangan tantanali marosimda, Tadbirkorlar va ishbilarmonlar harakati-O\'zbekiston liberal-demokratik partiyasining VII sezdida, turli xalqaro anjumanlarda, marosimlarda so\'zlagan nutq va ma\'ruzalari, tabriklari hamda Qoraqalpog\'iston Respublikasi, viloyatlar va Toshkent shahri saylovchilari bilan uchrashuvlardagi chiqishlarining qisqa bayoni o\'rin olgan.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2015, '', '', '323', NULL, NULL, 408, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-13 00:20:57', '2021-07-13 01:35:42', '978-9943-28-360-2', NULL, 0, 1, NULL, NULL),
