(70, 'O\'zbekiston mustaqillikka erishish ostonasida', 'Islom Karimov', NULL, NULL, NULL, 'O\'z-o\'zida ravshanki, yuqorida zikr etilgan ijtimoiy muammolarning asl ildizlari, salbiy oqibatlari ochib berilgan.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2012, '', '', '323', NULL, NULL, 176, 6010, 1, 1, 3, 1, 2, 1, 1, '2021-07-13 05:57:55', '2021-07-13 05:57:55', '978-99-43-02-466-3', NULL, 0, 1, NULL, NULL),
(71, 'Bosh maqsadimiz -keng ko\'lamli islohotlar va modernizatsiya yo\'lini qat\'iyat bilan davom ettirish.', 'Islom Karimov', NULL, NULL, NULL, 'Ayni vaqtda mamlakatimizda amalga oshirilayotgan islohotlar strategiyasining samaradorligi, inqirozga qarshi kurashish borasida to\'plangan tajribalar ta\'kidlandi.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2013, '', '', '323', NULL, NULL, 360, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-13 06:16:52', '2021-07-13 06:16:52', '978-9943-02-665-0', NULL, 0, 1, NULL, NULL),
(72, 'O\'zbekiston respublikasi prezidenti', 'Islom Karimov', NULL, NULL, NULL, 'Ushbu al\'bom O\'zbekiston bosib o\'tgan 16 yillik mustaqil taraqqiyot yo\'lini fatohujjatlar orqali tasvirlab berishga qaratilgan.', NULL, NULL, NULL, 'Toshkent', NULL, NULL, NULL, NULL, 'Toshkent', 2008, '', '', '0', NULL, NULL, 320, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-13 06:17:41', '2021-07-13 06:17:41', '0', NULL, 0, 1, NULL, NULL),
(73, 'Prezidentga maktublar', 'Islom Karimov', NULL, NULL, NULL, 'Ushbu to\'plamga Islom Karimov nomiga yo\'llangan maktub va nomalar orasidan tanlab olingan ayrim namunalar kiritilgan.', NULL, NULL, NULL, 'Toshkent', NULL, NULL, NULL, NULL, 'Toshkent', 2013, '', '', '0', NULL, NULL, 120, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-13 06:28:46', '2021-07-13 06:28:46', '0', NULL, 0, 1, NULL, NULL),
(74, 'Bosh maqsadimiz- iqtisodiyotimizda olib borayotgan islohotlarni va tarkibiy o\'zgarishlarni keskin chuqurlashtirish,  xususiy mulkchilik, kichik biznes va tadbirkorlikka keng yo\'l ochib berishdir', 'Islom Karimov', NULL, NULL, NULL, 'Shu nuqtai nazardan qaraganda, davlatimiz rahbarining ushbu ma\'ruzasini o\'qib-o\'rganish yurtdoshlarimizda mamlakat taqdiri , uning bugungi va ertangi istiqboliga nazari.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2016, '', '', '323', NULL, NULL, 376, 27055, 1, 1, 3, 1, 2, 1, 1, '2021-07-13 06:32:59', '2021-07-14 01:22:03', '978-9943-04-296-4', NULL, 0, 1, NULL, NULL),
(75, 'O\'zbekiston respublikasi prezidenti', 'Islom Karimov', NULL, NULL, NULL, 'Buyuk astronom va matematik Muxammad Xorazmiy 9 asrdayoq algebra faniga asos solgan va unga nom bergan.', NULL, NULL, NULL, 'Toshkent', NULL, NULL, NULL, NULL, NULL, 2013, '', '', '0', NULL, NULL, 320, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-13 06:38:00', '2021-07-13 06:38:00', '0', NULL, 0, 1, NULL, NULL),
