(77, 'Islom Karimov- mustaqil O\'zbekiston asoschisi', 'Islom Karimov', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Toshkent', NULL, NULL, NULL, NULL, 'Toshkent', 2018, '', '', '66.3(5o\')', NULL, NULL, 352, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-13 06:48:59', '2021-07-13 06:48:59', '978-9943-5064-5-9', NULL, 0, 0, NULL, NULL),
