(79, 'O\'zbekiston 25 mustaqilligining yigirma besh yilligi', 'Islom Karimov', NULL, NULL, NULL, 'Mazkur al\'bom O\'zbekistonimizning mustaqillik davrida bosib o\'tgan 25 yillik shonli yo\'li', NULL, NULL, NULL, 'Toshkent', NULL, NULL, NULL, NULL, 'Toshkent', 2016, '', '', '0', NULL, NULL, 340, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-13 07:00:56', '2021-07-13 07:00:56', '0', NULL, 0, 1, NULL, NULL),
(80, 'Yuksak-ma\'naviyat-yengilmas kuch', 'Islom Karimov', NULL, NULL, NULL, 'Ayni paytda istiqlol yillarida yurtimizda milliy ma\'naviyatimizni tiklash,uni zamon talablari asosida rivojlantirish bo\'yicha amalga oshirilayotgan ulkan ishlar,bu borada oldimizda turgan maqsad va vazifalar haqida  atroflicha fikr yuritiladi.', NULL, NULL, NULL, 'Ma\'naviyat', NULL, NULL, NULL, NULL, 'Toshkent', 2008, '', '', '323', NULL, NULL, 176, 0, 1, 1, 3, 1, 1, 2, 2, '2021-07-14 00:10:45', '2021-07-14 00:15:15', '978-9943-04-067-0', NULL, 0, 1, NULL, NULL),
(81, 'Bu muqaddas vatanda azizdir inson', 'Islom Karimov', NULL, NULL, NULL, 'Biz tarixi necha ming yillarni qamrab olgan halqmiz.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2010, '', '', '66.3(5Ў)6', NULL, NULL, 148, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-14 00:15:58', '2021-07-14 00:15:58', '978-9943-03-312-2', NULL, 0, 1, NULL, NULL),
(82, 'Yuksak-ma\'naviyat-yengilmas kuch', 'Islom Karimov', NULL, NULL, NULL, 'O\'tgan davr mobaynida bu kitob jahon miqyosida,xususan,musulmon olamida ham katta qiziqish uyg\'otdi va Quvayt davlatida arab tiliga,Turkiya Respublikasida turk tiliga tarjima qilindi.', NULL, NULL, NULL, 'Ma\'naviyat', NULL, NULL, NULL, NULL, 'Toshkent', 2010, '', '', '323', NULL, NULL, 176, 2900, 1, 1, 1, 1, 1, 2, 2, '2021-07-14 00:27:04', '2021-07-14 00:27:04', '978-9943-04-067-0-1', NULL, 0, 1, NULL, NULL),
(83, 'Yuksak-ma\'naviyat-yengilmas kuch', 'Islom Karimov', NULL, NULL, NULL, 'Ushbu asarda yoritilgan muhim masalalar keyingi paytda yanada dolzarb ahamiyat kasb etib borayotgani tufayli yurtimizdagi davlat va nodavlat tashkilotlar,ta\'lim muassasalari,oddiy yurtdoshlarimiz tomonidan \"Yuksak-ma\'naviyat-yengilmas kuch\" kitobini qayta nashr etish haqidagi bildirilgan ko\'plab takliflarni e\'tiborga olgan holda,mazkur kitob yana bir bor nashr etilmoqda.', NULL, NULL, NULL, 'Ma\'naviyat', NULL, NULL, NULL, NULL, 'Toshkent', 2016, '', '', '323', NULL, NULL, 176, 0, 1, 1, 3, 1, 1, 2, 2, '2021-07-14 00:34:09', '2021-07-14 00:34:09', '978-9943-04-067-0-2', NULL, 0, 1, NULL, NULL),
(84, 'Amalga oshirayotgan islohotlarimizni yanada chuqurlashtirish va fuqarolik jamiyati qurish-yorug\' kelajagimizning asosiy omilidir.', 'Islom Karimov', NULL, NULL, NULL, 'Dunyoviy, demokratik taraqqiyot yo\'lini tanlagan har bir davlatning suvereniteti, maqsad-vazifalari va boshqaruv shakli hamda usullarini asoslab beradigan bosh hujjat-bu uning Konstitutsiyasidir.', NULL, NULL, NULL, 'O\'qituvchi', NULL, NULL, NULL, NULL, 'Toshkent', 2014, '', '', '323(075)', NULL, NULL, 104, 6743, 1, 1, 2, 1, 2, 1, 1, '2021-07-14 00:35:16', '2021-07-14 01:18:19', '978-9943-02-762-6', NULL, 0, 1, NULL, NULL),
(85, 'Ona yurtimiz baxtu iqboli va buyuk kelajagi yo\'lida hizmat qilish - eng oliy saodatdir', 'Islom Karimov', NULL, NULL, NULL, 'Ona yurtimizning taqdiri uchun daxldorlik hissi tobora ortib borayotganini yana bir bor namoyon etdi.', NULL, NULL, NULL, 'Ma\'naviyat', NULL, NULL, NULL, NULL, 'Toshkent', 2016, '', '', '323(575.1)', NULL, NULL, 216, 17751, 1, 1, 2, 1, 2, 1, 1, '2021-07-14 00:44:48', '2021-07-14 01:19:01', '978-9943-04-287-2', NULL, 0, 1, NULL, NULL),
(86, 'Vatan va halq mangu qoladi', 'Islom Karimov', NULL, NULL, NULL, 'O\'zimiz o\'z qo\'limiz bilan qurgan mustaqil davlatchilik poydevori uzra O\'zbekiston deb atalgan yuksak va ko\'rkam bino qad ko\'tarmoqda.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 2010, '', '', '323', NULL, NULL, 136, 0, 1, 1, 2, 1, 2, 1, 1, '2021-07-14 01:01:48', '2021-07-14 01:18:03', '978-9943-06-266-5', NULL, 0, 1, NULL, NULL),
(87, 'Buyuk va muqaddassan,mustaqil vatan', 'A.Sh.Bekmorodov', NULL, NULL, NULL, 'Mazkur to\'plam keng kitobxonlar,xususan,talaba yoshlar,tadqiqitchi-izlanuvchilar,magistrantlar va joylarda tashviqot-targ\'ibot ishlarini olib boradigan ilmiy xodimlar uchun moljanlangan.', NULL, NULL, NULL, 'O\'qituvchi', NULL, NULL, NULL, NULL, 'Toshkent', 2011, '', '', '341', NULL, NULL, 200, 0, 1, 1, 3, 1, 2, 2, 2, '2021-07-14 01:02:38', '2021-07-14 01:02:38', '978-99-43-02-422-9', NULL, 0, 1, NULL, NULL),
