(95, 'O\'zbekiston: Davlat va uning yo\'lboshchisi', 'Muhammad as-Sayid Salim', NULL, NULL, NULL, 'Kitobda o\'zbek davlatchiligi rivojining qadimgi zamonlardan bugungacha bo\'lgan qisqa tarixi batafsil yoritilgan.', NULL, NULL, NULL, 'O\'zbekiston', NULL, NULL, NULL, NULL, 'Toshkent', 1999, '', '', '323', NULL, NULL, 219, 0, 1, 1, 3, 1, 2, 1, 1, '2021-07-14 01:48:39', '2021-07-14 01:48:39', '5-640-02805-X', NULL, 0, 1, NULL, NULL),
